// src/Pages/Home.js
import React from "react";

const Home = () => {
  return (
    <section className="bg-green-50 min-h-screen flex flex-col items-center justify-center px-4">
      <div className="text-center max-w-3xl">
        <h1 className="text-5xl font-bold text-green-800 mb-4">
          Welcome to KrishiAI
        </h1>
        <p className="text-lg text-green-700 mb-6">
          Empowering farmers with AI-powered insights and solutions.
        </p>
        <a
          href="/register"
          className="px-6 py-3 bg-green-600 text-white rounded-lg font-semibold hover:bg-green-700 transition"
        >
          Get Started
        </a>
      </div>
    </section>
  );
};

export default Home;
